import React from 'react'
import Announcements from '../components/Announcements';
import Navbar from '../components/Navbar';
import Slider from '../components/Slider';
import FirstSlide from '../components/FirstSlide';

function Home(){
    return(
        <div>
            <Announcements />
            <Navbar/>
            {/* <Slider /> */}
            <FirstSlide />
        </div>
    );
}

export default Home;
